def byte_to_bits(a):
    bits = np.zeros(8, dtype=np.uint8)
    for i in range(8):
        if (a>>i) & 1 == 1:
            bits[i] = 1
    return bits

def bytes_to_bits(b):
    bits = []
    for i in range(len(b)):
        bits.append(byte_to_bits(b[i]))
    return np.concatenate(bits)

